import React from 'react';

import { AiTwotoneHome } from "react-icons/all";

import { Wrapper, Header, Content, Footer, Button  } from './styles';

function Main() {
  return (
      <Wrapper>
        <Header>
         <h1>asasas</h1>
         <div>asasasas</div>
        </Header>
        <Content>
           <Button>
             <AiTwotoneHome size="20" color="#fff"  />
             <span>Clique aqui</span>
           </Button>
           <span>asahsaushasuahsuahsaus</span>
        </Content>
        <Footer>
          asasasaushasuahsaus
        </Footer>
      </Wrapper>  
  )
}

export default Main;
